import React, { Component } from 'react';
import './Authorization.scss';

class Authorization extends Component {
    render() {
        return (
            <div className="header__lk">
                <div className="header__auth-block">
                    <div className="header__enter">
                        <a href="/login/" className="header__enter-link">
                            Войти
                        </a>
                    </div>
                    <div className="header__register">
                        <a href="/register/" className="header__register-link">
                            Регистрация
                        </a>
                    </div>
                </div>
                <div className="header__personal">
                    <a href="/lk/" className="header__lk-link">
                        Личный кабинет
                    </a>
                </div>
            </div>
        );
    }
};

export default Authorization;
